import java.util.*;import java.io.*;import java.util.stream.*; public class Solution {	public static void main(String[] args) throws Exception {		BufferedReader in = new BufferedReader(new InputStreamReader(System.in));		StringBuilder a = new StringBuilder();		StringBuilder b = new StringBuilder();		int ch;		do {			ch = in.read();		} while(ch == '0');		a.append(ch).append(in.readLine());				do {			ch = in.read();		} while(ch == '0');		b.append(ch).append(in.readLine());				char result = '=';		if(a.length() > b.length()) {			result = '>';		} else 		if(a.length() < b.length()) {			result = '<';		} else {			int len = a.length();			int ind = 0;			while(ind < len && a.charAt(ind) == b.charAt(ind)) {				ind++;			}			if(ind < len) {				if(a.charAt(ind) < b.charAt(ind)) {					result = '<';				} else {					result = '>';				}			}		}		System.out.println(result);	}	}
